import React from 'react';
import ResponsiveNavBar from "../Partials/Header"



function Home() {
  return (
    <div className="flex flex-col min-h-screen overflow-hidden">

      {/*  Site header */}
      <ResponsiveNavBar />

      {/*  Page content */}
      <main className="flex-grow py-5 px-8 drop-shadow-2xl text-black font-sans">

      {/* home section */}
      <div class="relative bg-transparent mx-auto px-8 overflow-hidden sm:rounded-2xl">
        <div class="relative max-w-2xl py-16 px-8 sm:py-20 sm:px-8 lg:px-12">
          <h1 class="font-extrabold sm:text-6xl">
          Voyager <span className='border-b-8 border-teal-700'>confortablement</span>, avec des personnes de <span className='border-b-8 border-teal-700'>confiance</span>, et au <span className='border-b-8 border-teal-700'>prix le plus bas</span> !
          </h1>
          <p class="mt-8 text-lg leading-6 "><span className='text-teal-700'>+ de 400 000</span> membres font confiance à Nous et covoiturent chaque jour, partout au Maroc 🇲🇦</p>
          <div class="mt-10 mx-auto sm:max-w-none sm:flex sm:justify-center">
            <form className='inline-grid grid-cols-1 sm:grid-cols-3 sm:gap-6'>
                    <div class="relative z-0 mb-6 mt-4 w-full group">
                        <input type="email" name="floating_email" class="block py-2.5 px-0 w-full text-lg font-semibold  text-gray-900 bg-transparent border-0 border-b-2 border-gray-300 appearance-none dark:text-white dark:border-gray-600 dark:focus:border-teal-500 focus:outline-none focus:ring-0 focus:border-teal-600 peer" placeholder=" " required />
                        <label for="floating_email" class="absolute text-lg font-semibold  text-gray-500 dark:text-gray-400 duration-300 transform -translate-y-6 scale-75 top-3 -z-10 origin-[0] peer-focus:left-0 peer-focus:text-teal-600 peer-focus:dark:text-teal-500 peer-placeholder-shown:scale-100 peer-placeholder-shown:translate-y-0 peer-focus:scale-75 peer-focus:-translate-y-6">Email address</label>
                    </div>
                    <div class="relative z-0 mb-6 w-full group">
                        <input type="password" name="floating_password" id="floating_password" class="block py-2.5 px-0 w-full text-lg font-semibold  text-gray-900 bg-transparent border-0 border-b-2 border-gray-300 appearance-none dark:text-white dark:border-gray-600 dark:focus:border-teal-500 focus:outline-none focus:ring-0 focus:border-teal-600 peer" placeholder=" " required />
                        <label for="floating_password" class="absolute text-lg font-semibold  text-gray-500 dark:text-gray-400 duration-300 transform -translate-y-6 scale-75 top-3 -z-10 origin-[0] peer-focus:left-0 peer-focus:text-teal-600 peer-focus:dark:text-teal-500 peer-placeholder-shown:scale-100 peer-placeholder-shown:translate-y-0 peer-focus:scale-75 peer-focus:-translate-y-6">Password</label>
                    </div>
                    <button type="submit" class="text-white bg-teal-500 hover:bg-teal-600 focus:ring-4 focus:outline-none focus:ring-teal-500 font-semibold rounded-md text-lg w-full sm:w-full px-5 py-2.5 text-center dark:bg-teal-600 dark:hover:bg-teal-700 dark:focus:ring-teal-800">Submit</button>
                  </form>  
            </div>
          </div>
        </div>
        {/*  Page sections */}


      </main>

      {/*  Site footer */}


    </div>
  );
}

export default Home;
